import React from 'react';
import { StyleSheet, Text, View } from 'react-native';


const session1 = () => (
  <View>
    <Text style={styles.exercice}> 3x10 Dips / Traction (superset)</Text> 
    <Text style={styles.exercice}> Développé couché à la barre (travailler la force)</Text>
    <Text style={styles.exercice}> Butterfly</Text>
    <Text style={styles.exercice}> Rowing haltère sur banc incliné</Text>
    <Text style={styles.exercice}> Tirage verticale</Text>
    <Text style={styles.exercice}> Superman / Crunch jambes verticales</Text>
  </View>
);

const styles = StyleSheet.create({
  exercice: {
    fontWeight: 'bold',
    padding: 20,
    marginTop: 10,
  },
});

export default session1;
